import React, { useEffect } from "react";
import { useNavigate } from "react-router-dom";
import useAuth from "../hooks/useAuth";

const Management = () => {
  const { auth } = useAuth();
  const navigate = useNavigate();

  useEffect(() => {
    console.log("Navigating based on role:", auth.role); // Debugging line

    if (auth.role) {
      switch (auth.role) {
        case "admin":
          navigate("/admin");
          break;
        case "user":
          navigate("/");
          break;
        default:
          navigate("/error"); // Navigate to an error page or default route
      }
    } else {
      navigate("/error"); // Navigate to an error page if no role is found
    }
  }, [auth.role, navigate]);

  // Render a loading indicator while navigating
  return (
    <div>
      <p>Loading...</p>
    </div>
  );
};

export default Management;
